import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Head.css';
const Head = () => {
    const navigate = useNavigate(); // Initialize useNavigate

    const handllogoClick = () => {
        console.log("Logo clicked");
      navigate('/home'); // Navigate to /portfolioslist when Back button is clicked
    };

    return (
        <header>
            <nav className="curve">
       
                <i className="bi bi-list" style={{ fontSize: "2rem", cursor: "pointer" }}></i>
                <img src="/logo.png" alt="ICA Logo" className="img-fluid" style={{ maxWidth: '25%', maxHeight: '25%' }} onClick={handllogoClick}/>
                <i className="bi bi-person" style={{ fontSize: "2rem", color: "white" }}></i>
            </nav>
            
        </header>
     );
};

export default Head;
